searchData={"items":[{"type":"module","title":"MsappMcpWeb","doc":"The entrypoint for defining your web interface, such\nas controllers, components, channels, and so on.\n\nThis can be used in your application as:\n\n    use MsappMcpWeb, :controller\n    use MsappMcpWeb, :html\n\nThe definitions below will be executed for every controller,\ncomponent, etc, so keep them short and clean, focused\non imports, uses and aliases.\n\nDo NOT define functions inside the quoted expressions\nbelow. Instead, define additional modules and import\nthose modules here.","ref":"MsappMcpWeb.html"},{"type":"macro","title":"MsappMcpWeb.__using__/1","doc":"When used, dispatch to the appropriate controller/view/etc.","ref":"MsappMcpWeb.html#__using__/1"},{"type":"function","title":"MsappMcpWeb.bootstrap_live_view/0","doc":"","ref":"MsappMcpWeb.html#bootstrap_live_view/0"},{"type":"function","title":"MsappMcpWeb.channel/0","doc":"","ref":"MsappMcpWeb.html#channel/0"},{"type":"function","title":"MsappMcpWeb.controller/0","doc":"","ref":"MsappMcpWeb.html#controller/0"},{"type":"function","title":"MsappMcpWeb.html/0","doc":"","ref":"MsappMcpWeb.html#html/0"},{"type":"function","title":"MsappMcpWeb.live_component/0","doc":"","ref":"MsappMcpWeb.html#live_component/0"},{"type":"function","title":"MsappMcpWeb.live_view/0","doc":"","ref":"MsappMcpWeb.html#live_view/0"},{"type":"function","title":"MsappMcpWeb.login_live_view/0","doc":"","ref":"MsappMcpWeb.html#login_live_view/0"},{"type":"function","title":"MsappMcpWeb.router/0","doc":"","ref":"MsappMcpWeb.html#router/0"},{"type":"function","title":"MsappMcpWeb.static_paths/0","doc":"","ref":"MsappMcpWeb.html#static_paths/0"},{"type":"function","title":"MsappMcpWeb.verified_routes/0","doc":"","ref":"MsappMcpWeb.html#verified_routes/0"},{"type":"module","title":"MsappMcpWeb.CoreComponents","doc":"Provides core UI components.\n\nThe components in this module use Tailwind CSS, a utility-first CSS framework.\nSee the [Tailwind CSS documentation](https://tailwindcss.com) to learn how to\ncustomize the generated components in this module.\n\nIcons are provided by [heroicons](https://heroicons.com). See `icon/1` for usage.","ref":"MsappMcpWeb.CoreComponents.html"},{"type":"function","title":"MsappMcpWeb.CoreComponents.back/1","doc":"Renders a back navigation link.","ref":"MsappMcpWeb.CoreComponents.html#back/1"},{"type":"function","title":"Examples - MsappMcpWeb.CoreComponents.back/1","doc":"Back to posts","ref":"MsappMcpWeb.CoreComponents.html#back/1-examples"},{"type":"function","title":"Attributes - MsappMcpWeb.CoreComponents.back/1","doc":"* `navigate` (`:any`) (required)","ref":"MsappMcpWeb.CoreComponents.html#back/1-attributes"},{"type":"function","title":"Slots - MsappMcpWeb.CoreComponents.back/1","doc":"* `inner_block` (required)","ref":"MsappMcpWeb.CoreComponents.html#back/1-slots"},{"type":"function","title":"MsappMcpWeb.CoreComponents.button/1","doc":"Renders a button.","ref":"MsappMcpWeb.CoreComponents.html#button/1"},{"type":"function","title":"Examples - MsappMcpWeb.CoreComponents.button/1","doc":"Send! \n     Send!","ref":"MsappMcpWeb.CoreComponents.html#button/1-examples"},{"type":"function","title":"Attributes - MsappMcpWeb.CoreComponents.button/1","doc":"* `type` (`:string`) - Defaults to `nil`.\n* `class` (`:string`) - Defaults to `nil`.\n* Global attributes are accepted.","ref":"MsappMcpWeb.CoreComponents.html#button/1-attributes"},{"type":"function","title":"Slots - MsappMcpWeb.CoreComponents.button/1","doc":"* `inner_block` (required)","ref":"MsappMcpWeb.CoreComponents.html#button/1-slots"},{"type":"function","title":"MsappMcpWeb.CoreComponents.error/1","doc":"Generates a generic error message.","ref":"MsappMcpWeb.CoreComponents.html#error/1"},{"type":"function","title":"Slots - MsappMcpWeb.CoreComponents.error/1","doc":"* `inner_block` (required)","ref":"MsappMcpWeb.CoreComponents.html#error/1-slots"},{"type":"function","title":"MsappMcpWeb.CoreComponents.flash/1","doc":"Renders flash notices.","ref":"MsappMcpWeb.CoreComponents.html#flash/1"},{"type":"function","title":"Examples - MsappMcpWeb.CoreComponents.flash/1","doc":"Welcome Back!","ref":"MsappMcpWeb.CoreComponents.html#flash/1-examples"},{"type":"function","title":"Attributes - MsappMcpWeb.CoreComponents.flash/1","doc":"* `id` (`:string`) - the optional id of flash container. Defaults to `\"flash\"`.\n* `flash` (`:map`) - the map of flash messages to display. Defaults to `%{}`.\n* `title` (`:string`) - Defaults to `nil`.\n* `kind` (`:atom`) - used for styling and flash lookup.Must be one of `:info`, or `:error`.\n* `autoshow` (`:boolean`) - whether to auto show the flash on mount. Defaults to `true`.\n* `close` (`:boolean`) - whether the flash can be closed. Defaults to `true`.\n* Global attributes are accepted.","ref":"MsappMcpWeb.CoreComponents.html#flash/1-attributes"},{"type":"function","title":"Slots - MsappMcpWeb.CoreComponents.flash/1","doc":"* `inner_block` - the optional inner block that renders the flash message.","ref":"MsappMcpWeb.CoreComponents.html#flash/1-slots"},{"type":"function","title":"MsappMcpWeb.CoreComponents.flash_group/1","doc":"Shows the flash group with standard titles and content.","ref":"MsappMcpWeb.CoreComponents.html#flash_group/1"},{"type":"function","title":"Examples - MsappMcpWeb.CoreComponents.flash_group/1","doc":"","ref":"MsappMcpWeb.CoreComponents.html#flash_group/1-examples"},{"type":"function","title":"Attributes - MsappMcpWeb.CoreComponents.flash_group/1","doc":"* `flash` (`:map`) (required) - the map of flash messages.","ref":"MsappMcpWeb.CoreComponents.html#flash_group/1-attributes"},{"type":"function","title":"MsappMcpWeb.CoreComponents.header/1","doc":"Renders a header with title.","ref":"MsappMcpWeb.CoreComponents.html#header/1"},{"type":"function","title":"Attributes - MsappMcpWeb.CoreComponents.header/1","doc":"* `class` (`:string`) - Defaults to `nil`.","ref":"MsappMcpWeb.CoreComponents.html#header/1-attributes"},{"type":"function","title":"Slots - MsappMcpWeb.CoreComponents.header/1","doc":"* `inner_block` (required)\n* `subtitle`\n* `actions`","ref":"MsappMcpWeb.CoreComponents.html#header/1-slots"},{"type":"function","title":"MsappMcpWeb.CoreComponents.hide/2","doc":"","ref":"MsappMcpWeb.CoreComponents.html#hide/2"},{"type":"function","title":"MsappMcpWeb.CoreComponents.hide_modal/2","doc":"","ref":"MsappMcpWeb.CoreComponents.html#hide_modal/2"},{"type":"function","title":"MsappMcpWeb.CoreComponents.icon/1","doc":"Renders a [Hero Icon](https://heroicons.com).\n\nHero icons come in three styles â€“ outline, solid, and mini.\nBy default, the outline style is used, but solid an mini may\nbe applied by using the `-solid` and `-mini` suffix.\n\nYou can customize the size and colors of the icons by setting\nwidth, height, and background color classes.\n\nIcons are extracted from your `priv/hero_icons` directory and bundled\nwithin your compiled app.css by the plugin in your `assets/tailwind.config.js`.","ref":"MsappMcpWeb.CoreComponents.html#icon/1"},{"type":"function","title":"Examples - MsappMcpWeb.CoreComponents.icon/1","doc":"","ref":"MsappMcpWeb.CoreComponents.html#icon/1-examples"},{"type":"function","title":"Attributes - MsappMcpWeb.CoreComponents.icon/1","doc":"* `name` (`:string`) (required)\n* `class` (`:string`) - Defaults to `nil`.","ref":"MsappMcpWeb.CoreComponents.html#icon/1-attributes"},{"type":"function","title":"MsappMcpWeb.CoreComponents.input/1","doc":"Renders an input with label and error messages.\n\nA `%Phoenix.HTML.Form{}` and field name may be passed to the input\nto build input names and error messages, or all the attributes and\nerrors may be passed explicitly.","ref":"MsappMcpWeb.CoreComponents.html#input/1"},{"type":"function","title":"Examples - MsappMcpWeb.CoreComponents.input/1","doc":"","ref":"MsappMcpWeb.CoreComponents.html#input/1-examples"},{"type":"function","title":"Attributes - MsappMcpWeb.CoreComponents.input/1","doc":"* `id` (`:any`) - Defaults to `nil`.\n* `name` (`:any`)\n* `label` (`:string`) - Defaults to `nil`.\n* `value` (`:any`)\n* `type` (`:string`) - Defaults to `\"text\"`.\n* `field` (`Phoenix.HTML.FormField`) - a form field struct retrieved from the form, for example: @form[:email].\n* `errors` (`:list`) - Defaults to `[]`.\n* `checked` (`:boolean`) - the checked flag for checkbox inputs.\n* `prompt` (`:string`) - the prompt for select inputs. Defaults to `nil`.\n* `options` (`:list`) - the options to pass to Phoenix.HTML.Form.options_for_select/2.\n* `multiple` (`:boolean`) - the multiple flag for select inputs. Defaults to `false`.\n* Global attributes are accepted.","ref":"MsappMcpWeb.CoreComponents.html#input/1-attributes"},{"type":"function","title":"Slots - MsappMcpWeb.CoreComponents.input/1","doc":"* `inner_block`","ref":"MsappMcpWeb.CoreComponents.html#input/1-slots"},{"type":"function","title":"MsappMcpWeb.CoreComponents.label/1","doc":"Renders a label.","ref":"MsappMcpWeb.CoreComponents.html#label/1"},{"type":"function","title":"Attributes - MsappMcpWeb.CoreComponents.label/1","doc":"* `for` (`:string`) - Defaults to `nil`.","ref":"MsappMcpWeb.CoreComponents.html#label/1-attributes"},{"type":"function","title":"Slots - MsappMcpWeb.CoreComponents.label/1","doc":"* `inner_block` (required)","ref":"MsappMcpWeb.CoreComponents.html#label/1-slots"},{"type":"function","title":"MsappMcpWeb.CoreComponents.list/1","doc":"Renders a data list.","ref":"MsappMcpWeb.CoreComponents.html#list/1"},{"type":"function","title":"Examples - MsappMcpWeb.CoreComponents.list/1","doc":"","ref":"MsappMcpWeb.CoreComponents.html#list/1-examples"},{"type":"function","title":"Slots - MsappMcpWeb.CoreComponents.list/1","doc":"* `item` (required) - Accepts attributes:\n\n  * `title` (`:string`) (required)","ref":"MsappMcpWeb.CoreComponents.html#list/1-slots"},{"type":"function","title":"MsappMcpWeb.CoreComponents.modal/1","doc":"Renders a modal.","ref":"MsappMcpWeb.CoreComponents.html#modal/1"},{"type":"function","title":"Examples - MsappMcpWeb.CoreComponents.modal/1","doc":"Are you sure?\n       OK \n       Cancel \n     \n\nJS commands may be passed to the `:on_cancel` and `on_confirm` attributes\nfor the caller to react to each button press, for example:\n\n     \n      Are you sure you?\n       OK \n       Cancel","ref":"MsappMcpWeb.CoreComponents.html#modal/1-examples"},{"type":"function","title":"Attributes - MsappMcpWeb.CoreComponents.modal/1","doc":"* `id` (`:string`) (required)\n* `show` (`:boolean`) - Defaults to `false`.\n* `on_cancel` (`Phoenix.LiveView.JS`) - Defaults to `%Phoenix.LiveView.JS{ops: []}`.\n* `on_confirm` (`Phoenix.LiveView.JS`) - Defaults to `%Phoenix.LiveView.JS{ops: []}`.","ref":"MsappMcpWeb.CoreComponents.html#modal/1-attributes"},{"type":"function","title":"Slots - MsappMcpWeb.CoreComponents.modal/1","doc":"* `inner_block` (required)\n* `title`\n* `subtitle`\n* `confirm`\n* `cancel`","ref":"MsappMcpWeb.CoreComponents.html#modal/1-slots"},{"type":"function","title":"MsappMcpWeb.CoreComponents.show/2","doc":"","ref":"MsappMcpWeb.CoreComponents.html#show/2"},{"type":"function","title":"MsappMcpWeb.CoreComponents.show_modal/2","doc":"","ref":"MsappMcpWeb.CoreComponents.html#show_modal/2"},{"type":"function","title":"MsappMcpWeb.CoreComponents.simple_form/1","doc":"Renders a simple form.","ref":"MsappMcpWeb.CoreComponents.html#simple_form/1"},{"type":"function","title":"Examples - MsappMcpWeb.CoreComponents.simple_form/1","doc":"Save","ref":"MsappMcpWeb.CoreComponents.html#simple_form/1-examples"},{"type":"function","title":"Attributes - MsappMcpWeb.CoreComponents.simple_form/1","doc":"* `for` (`:any`) (required) - the datastructure for the form.\n* `as` (`:any`) - the server side parameter to collect all input under. Defaults to `nil`.\n* Global attributes are accepted.","ref":"MsappMcpWeb.CoreComponents.html#simple_form/1-attributes"},{"type":"function","title":"Slots - MsappMcpWeb.CoreComponents.simple_form/1","doc":"* `inner_block` (required)\n* `actions` - the slot for form actions, such as a submit button.","ref":"MsappMcpWeb.CoreComponents.html#simple_form/1-slots"},{"type":"function","title":"MsappMcpWeb.CoreComponents.table/1","doc":"Renders a table with generic styling.","ref":"MsappMcpWeb.CoreComponents.html#table/1"},{"type":"function","title":"Examples - MsappMcpWeb.CoreComponents.table/1","doc":"","ref":"MsappMcpWeb.CoreComponents.html#table/1-examples"},{"type":"function","title":"Attributes - MsappMcpWeb.CoreComponents.table/1","doc":"* `id` (`:string`) (required)\n* `rows` (`:list`) (required)\n* `row_id` (`:any`) - the function for generating the row id. Defaults to `nil`.\n* `row_click` (`:any`) - the function for handling phx-click on each row. Defaults to `nil`.\n* `row_item` (`:any`) - the function for mapping each row before calling the :col and :action slots. Defaults to `&Function.identity/1`.","ref":"MsappMcpWeb.CoreComponents.html#table/1-attributes"},{"type":"function","title":"Slots - MsappMcpWeb.CoreComponents.table/1","doc":"* `col` (required) - Accepts attributes:\n\n  * `label` (`:string`)\n* `action` - the slot for showing user actions in the last table column.","ref":"MsappMcpWeb.CoreComponents.html#table/1-slots"},{"type":"function","title":"MsappMcpWeb.CoreComponents.translate_error/1","doc":"Translates an error message using gettext.","ref":"MsappMcpWeb.CoreComponents.html#translate_error/1"},{"type":"function","title":"MsappMcpWeb.CoreComponents.translate_errors/2","doc":"Translates the errors for a field from a keyword list of errors.","ref":"MsappMcpWeb.CoreComponents.html#translate_errors/2"},{"type":"module","title":"MsappMcpWeb.Endpoint","doc":"","ref":"MsappMcpWeb.Endpoint.html"},{"type":"function","title":"MsappMcpWeb.Endpoint.broadcast/3","doc":"","ref":"MsappMcpWeb.Endpoint.html#broadcast/3"},{"type":"function","title":"MsappMcpWeb.Endpoint.broadcast!/3","doc":"","ref":"MsappMcpWeb.Endpoint.html#broadcast!/3"},{"type":"function","title":"MsappMcpWeb.Endpoint.broadcast_from/4","doc":"","ref":"MsappMcpWeb.Endpoint.html#broadcast_from/4"},{"type":"function","title":"MsappMcpWeb.Endpoint.broadcast_from!/4","doc":"","ref":"MsappMcpWeb.Endpoint.html#broadcast_from!/4"},{"type":"function","title":"MsappMcpWeb.Endpoint.call/2","doc":"","ref":"MsappMcpWeb.Endpoint.html#call/2"},{"type":"function","title":"MsappMcpWeb.Endpoint.child_spec/1","doc":"Returns the child specification to start the endpoint\nunder a supervision tree.","ref":"MsappMcpWeb.Endpoint.html#child_spec/1"},{"type":"function","title":"MsappMcpWeb.Endpoint.config/2","doc":"Returns the endpoint configuration for `key`\n\nReturns `default` if the key does not exist.","ref":"MsappMcpWeb.Endpoint.html#config/2"},{"type":"function","title":"MsappMcpWeb.Endpoint.config_change/2","doc":"Reloads the configuration given the application environment changes.","ref":"MsappMcpWeb.Endpoint.html#config_change/2"},{"type":"function","title":"MsappMcpWeb.Endpoint.host/0","doc":"Returns the host for the given endpoint.","ref":"MsappMcpWeb.Endpoint.html#host/0"},{"type":"function","title":"MsappMcpWeb.Endpoint.init/1","doc":"","ref":"MsappMcpWeb.Endpoint.html#init/1"},{"type":"function","title":"MsappMcpWeb.Endpoint.local_broadcast/3","doc":"","ref":"MsappMcpWeb.Endpoint.html#local_broadcast/3"},{"type":"function","title":"MsappMcpWeb.Endpoint.local_broadcast_from/4","doc":"","ref":"MsappMcpWeb.Endpoint.html#local_broadcast_from/4"},{"type":"function","title":"MsappMcpWeb.Endpoint.path/1","doc":"Generates the path information when routing to this endpoint.","ref":"MsappMcpWeb.Endpoint.html#path/1"},{"type":"function","title":"MsappMcpWeb.Endpoint.script_name/0","doc":"Generates the script name.","ref":"MsappMcpWeb.Endpoint.html#script_name/0"},{"type":"function","title":"MsappMcpWeb.Endpoint.start_link/1","doc":"Starts the endpoint supervision tree.\n\nAll other options are merged into the endpoint configuration.","ref":"MsappMcpWeb.Endpoint.html#start_link/1"},{"type":"function","title":"MsappMcpWeb.Endpoint.static_integrity/1","doc":"Generates a base64-encoded cryptographic hash (sha512) to a static file\nin `priv/static`. Meant to be used for Subresource Integrity with CDNs.","ref":"MsappMcpWeb.Endpoint.html#static_integrity/1"},{"type":"function","title":"MsappMcpWeb.Endpoint.static_lookup/1","doc":"Returns a two item tuple with the first item being the `static_path`\nand the second item being the `static_integrity`.","ref":"MsappMcpWeb.Endpoint.html#static_lookup/1"},{"type":"function","title":"MsappMcpWeb.Endpoint.static_path/1","doc":"Generates a route to a static file in `priv/static`.","ref":"MsappMcpWeb.Endpoint.html#static_path/1"},{"type":"function","title":"MsappMcpWeb.Endpoint.static_url/0","doc":"Generates the static URL without any path information.\n\nIt uses the configuration under `:static_url` to generate\nsuch. It falls back to `:url` if `:static_url` is not set.","ref":"MsappMcpWeb.Endpoint.html#static_url/0"},{"type":"function","title":"MsappMcpWeb.Endpoint.struct_url/0","doc":"Generates the endpoint base URL but as a `URI` struct.\n\nIt uses the configuration under `:url` to generate such.\nUseful for manipulating the URL data and passing it to\nURL helpers.","ref":"MsappMcpWeb.Endpoint.html#struct_url/0"},{"type":"function","title":"MsappMcpWeb.Endpoint.subscribe/2","doc":"","ref":"MsappMcpWeb.Endpoint.html#subscribe/2"},{"type":"function","title":"MsappMcpWeb.Endpoint.unsubscribe/1","doc":"","ref":"MsappMcpWeb.Endpoint.html#unsubscribe/1"},{"type":"function","title":"MsappMcpWeb.Endpoint.url/0","doc":"Generates the endpoint base URL without any path information.\n\nIt uses the configuration under `:url` to generate such.","ref":"MsappMcpWeb.Endpoint.html#url/0"},{"type":"module","title":"MsappMcpWeb.ErrorHTML","doc":"","ref":"MsappMcpWeb.ErrorHTML.html"},{"type":"function","title":"MsappMcpWeb.ErrorHTML.render/2","doc":"","ref":"MsappMcpWeb.ErrorHTML.html#render/2"},{"type":"module","title":"MsappMcpWeb.ErrorJSON","doc":"","ref":"MsappMcpWeb.ErrorJSON.html"},{"type":"function","title":"MsappMcpWeb.ErrorJSON.render/2","doc":"","ref":"MsappMcpWeb.ErrorJSON.html#render/2"},{"type":"module","title":"MsappMcpWeb.Gettext","doc":"A module providing Internationalization with a gettext-based API.\n\nBy using [Gettext](https://hexdocs.pm/gettext),\nyour module gains a set of macros for translations, for example:\n\n    import MsappMcpWeb.Gettext\n\n    # Simple translation\n    gettext(\"Here is the string to translate\")\n\n    # Plural translation\n    ngettext(\"Here is the string to translate\",\n             \"Here are the strings to translate\",\n             3)\n\n    # Domain-based translation\n    dgettext(\"errors\", \"Here is the error message to translate\")\n\nSee the [Gettext Docs](https://hexdocs.pm/gettext) for detailed usage.","ref":"MsappMcpWeb.Gettext.html"},{"type":"macro","title":"MsappMcpWeb.Gettext.dgettext/3","doc":"","ref":"MsappMcpWeb.Gettext.html#dgettext/3"},{"type":"macro","title":"MsappMcpWeb.Gettext.dgettext_noop/2","doc":"","ref":"MsappMcpWeb.Gettext.html#dgettext_noop/2"},{"type":"macro","title":"MsappMcpWeb.Gettext.dngettext/5","doc":"","ref":"MsappMcpWeb.Gettext.html#dngettext/5"},{"type":"macro","title":"MsappMcpWeb.Gettext.dngettext_noop/3","doc":"","ref":"MsappMcpWeb.Gettext.html#dngettext_noop/3"},{"type":"macro","title":"MsappMcpWeb.Gettext.dpgettext/4","doc":"","ref":"MsappMcpWeb.Gettext.html#dpgettext/4"},{"type":"macro","title":"MsappMcpWeb.Gettext.dpgettext_noop/3","doc":"","ref":"MsappMcpWeb.Gettext.html#dpgettext_noop/3"},{"type":"macro","title":"MsappMcpWeb.Gettext.dpngettext/6","doc":"","ref":"MsappMcpWeb.Gettext.html#dpngettext/6"},{"type":"macro","title":"MsappMcpWeb.Gettext.dpngettext_noop/4","doc":"","ref":"MsappMcpWeb.Gettext.html#dpngettext_noop/4"},{"type":"macro","title":"MsappMcpWeb.Gettext.gettext/2","doc":"","ref":"MsappMcpWeb.Gettext.html#gettext/2"},{"type":"macro","title":"MsappMcpWeb.Gettext.gettext_comment/1","doc":"","ref":"MsappMcpWeb.Gettext.html#gettext_comment/1"},{"type":"macro","title":"MsappMcpWeb.Gettext.gettext_noop/1","doc":"","ref":"MsappMcpWeb.Gettext.html#gettext_noop/1"},{"type":"function","title":"MsappMcpWeb.Gettext.handle_missing_bindings/2","doc":"","ref":"MsappMcpWeb.Gettext.html#handle_missing_bindings/2"},{"type":"function","title":"MsappMcpWeb.Gettext.handle_missing_plural_translation/7","doc":"","ref":"MsappMcpWeb.Gettext.html#handle_missing_plural_translation/7"},{"type":"function","title":"MsappMcpWeb.Gettext.handle_missing_translation/5","doc":"","ref":"MsappMcpWeb.Gettext.html#handle_missing_translation/5"},{"type":"function","title":"MsappMcpWeb.Gettext.lgettext/5","doc":"","ref":"MsappMcpWeb.Gettext.html#lgettext/5"},{"type":"function","title":"MsappMcpWeb.Gettext.lngettext/7","doc":"","ref":"MsappMcpWeb.Gettext.html#lngettext/7"},{"type":"macro","title":"MsappMcpWeb.Gettext.ngettext/4","doc":"","ref":"MsappMcpWeb.Gettext.html#ngettext/4"},{"type":"macro","title":"MsappMcpWeb.Gettext.ngettext_noop/2","doc":"","ref":"MsappMcpWeb.Gettext.html#ngettext_noop/2"},{"type":"macro","title":"MsappMcpWeb.Gettext.pgettext/3","doc":"","ref":"MsappMcpWeb.Gettext.html#pgettext/3"},{"type":"macro","title":"MsappMcpWeb.Gettext.pgettext_noop/2","doc":"","ref":"MsappMcpWeb.Gettext.html#pgettext_noop/2"},{"type":"macro","title":"MsappMcpWeb.Gettext.pngettext/5","doc":"","ref":"MsappMcpWeb.Gettext.html#pngettext/5"},{"type":"macro","title":"MsappMcpWeb.Gettext.pngettext_noop/3","doc":"","ref":"MsappMcpWeb.Gettext.html#pngettext_noop/3"},{"type":"module","title":"MsappMcpWeb.PageController","doc":"","ref":"MsappMcpWeb.PageController.html"},{"type":"function","title":"MsappMcpWeb.PageController.home/2","doc":"","ref":"MsappMcpWeb.PageController.html#home/2"},{"type":"module","title":"MsappMcpWeb.PageHTML","doc":"","ref":"MsappMcpWeb.PageHTML.html"},{"type":"function","title":"MsappMcpWeb.PageHTML.home/1","doc":"","ref":"MsappMcpWeb.PageHTML.html#home/1"},{"type":"module","title":"MsappMcpWeb.Router","doc":"","ref":"MsappMcpWeb.Router.html"},{"type":"function","title":"MsappMcpWeb.Router.api/2","doc":"","ref":"MsappMcpWeb.Router.html#api/2"},{"type":"function","title":"MsappMcpWeb.Router.authenticated/2","doc":"","ref":"MsappMcpWeb.Router.html#authenticated/2"},{"type":"function","title":"MsappMcpWeb.Router.bootstrap/2","doc":"","ref":"MsappMcpWeb.Router.html#bootstrap/2"},{"type":"function","title":"MsappMcpWeb.Router.browser/2","doc":"","ref":"MsappMcpWeb.Router.html#browser/2"},{"type":"function","title":"MsappMcpWeb.Router.call/2","doc":"Callback invoked by Plug on every request.","ref":"MsappMcpWeb.Router.html#call/2"},{"type":"function","title":"MsappMcpWeb.Router.init/1","doc":"Callback required by Plug that initializes the router\nfor serving web requests.","ref":"MsappMcpWeb.Router.html#init/1"},{"type":"function","title":"MsappMcpWeb.Router.logout/2","doc":"","ref":"MsappMcpWeb.Router.html#logout/2"},{"type":"function","title":"MsappMcpWeb.Router.no_bootstrap/2","doc":"","ref":"MsappMcpWeb.Router.html#no_bootstrap/2"}],"content_type":"text/markdown"}